import React from 'react';
import {NavLink} from 'react-router-dom';

const SignedIn = () => {
    return(
        <ul class="right">
            <li><NavLink to='/'>make poop</NavLink></li>
            <li><NavLink to='/'>Log Out</NavLink></li>
        </ul>
    )
}

export default SignedIn;
